import React from 'react';
import Typewriter from "typewriter-effect";
import beerguy from '../img/beerguy.png';

let beerguy2 = require('../img/beerguy.png');

export class LandingPage extends React.Component {

    render() {
        return(
            <div className='mt-32 flex items-center justify-center'>

                <div className='h-64 w-80 rounded-xl bg-violet-300 flex items-center justify-center shadow-2xl'>
                    <h1 className='text-4xl'>
                        <Typewriter 
                            options = {{
                                strings: ["Welcome", "Bienvenido", "Salut", "Privet", "Yōkoso"],
                                autoStart: true,
                                loop: true,
                                cursor: "_"
                            }}
                        />
                        <img alt="beer guy" src={"../img/beerguy.png"}/>
                    </h1>
                </div>

            </div>
        );
    }
}
